import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import { useState } from 'react';
import Login from './pages/Login';
import Chat from './pages/Chat';
import History from './pages/History';
import Analytics from './pages/Analytics';
import { BoltIcon } from '@heroicons/react/24/outline'; // Imported icon

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(!!localStorage.getItem('token'));
  const [isDarkMode, setIsDarkMode] = useState(false);

  const toggleDarkMode = () => {
    setIsDarkMode(!isDarkMode);
    document.documentElement.classList.toggle('dark');
  };

  return (
    <Router>
      <div className={`min-h-screen ${isDarkMode ? 'dark' : ''}`}>
        {isAuthenticated && (
          <div className="flex">
            {/* Sidebar */}
            <div className="w-64 bg-gradient-to-b from-blue-900 to-purple-900 dark:from-gray-900 dark:to-gray-800 h-screen p-6 shadow-lg text-white">
              <div className="flex items-center mb-8">
                <BoltIcon className="w-8 h-8 mr-2" /> {/* Using Heroicon */}
                <h1 className="text-2xl font-bold">Creator Platform</h1>
              </div>
              <nav className="space-y-3">
                <Link to="/chat" className="sidebar-link">New Chat</Link>
                <Link to="/history" className="sidebar-link">Content History</Link>
                <Link to="/analytics" className="sidebar-link">Analytics</Link>
                <button
                  onClick={() => {
                    localStorage.removeItem('token');
                    setIsAuthenticated(false);
                  }}
                  className="sidebar-link text-red-400 hover:text-red-300"
                >
                  Logout
                </button>
              </nav>
              <button
                onClick={toggleDarkMode}
                className="mt-6 p-3 w-full text-left rounded-xl bg-gray-800 hover:bg-gray-700 text-white"
              >
                {isDarkMode ? 'Light Mode' : 'Dark Mode'}
              </button>
            </div>
            {/* Main Content */}
            <div className="flex-1 p-8">
              <Routes>
                <Route path="/login" element={<Login setIsAuthenticated={setIsAuthenticated} />} />
                <Route
                  path="/chat"
                  element={isAuthenticated ? <Chat /> : <Navigate to="/login" />}
                />
                <Route
                  path="/history"
                  element={isAuthenticated ? <History /> : <Navigate to="/login" />}
                />
                <Route
                  path="/analytics"
                  element={isAuthenticated ? <Analytics /> : <Navigate to="/login" />}
                />
                <Route path="/" element={<Navigate to="/login" />} />
              </Routes>
            </div>
          </div>
        )}
        {!isAuthenticated && (
          <Routes>
            <Route path="/login" element={<Login setIsAuthenticated={setIsAuthenticated} />} />
            <Route path="*" element={<Navigate to="/login" />} />
          </Routes>
        )}
      </div>
    </Router>
  );
}

export default App;
